import React from 'react';
import axios from 'axios';

const Fish = () => {
    const [fish, setFish] = useState("");

    useEffect (() => {
        axios.get(`https://acnhapi.com/v1a/fish`)
        .then(response => {
            console.log(response.data);
            setFish(response.data)
        })
        .catch(error => {
            console.log(error)
        })
}, []);

    return (<div>
        {/* {JSON.stringify(seas)} */}
        <h1>Fish</h1>
            {fish ?
                fish.map((fish, idx) => {
                    return (
                            <img style={{width: "75px"}} key={fish.id} src={`https://acnhapi.com/v1/images/fish/${fish.id}`}/>
                    )
                })
            :
            <p>Loading..</p>}
    </div>)
};

export default Fish;
